import React from 'react';
import logo from './logo.svg';
import './App.css';

import {createStore} from 'redux';
import allReducers from './reducers';

const store = createStore(allReducers);

function App() {
	return (
		<div className="App">
			<h1 onClick={store.dispatch({ type: 'INCREMENT' })}>Hello</h1>
		</div>
	);
}

export default App;
